import React from 'react';
import StyledTitle from './Titles';
import styled from 'styled-components';
import { Col, Row } from 'antd';

const Paragraph = styled.div`
  p.subTitle {
    font-size: 1rem;
    font-weight: bold;
    span + span {
      margin-left: 10px;
    }
  }
  .intro {
    font-size: 1rem;
    color: #9e73a5;
    margin-bottom: 0.5rem;
  }
  .txt {
    color: #666666;
  }
`;

const AboutMe = () => {
  return (
    <div style={{ padding: '0 2rem' }}>
      <StyledTitle>
        <span>웹 프론트엔드 개발자 김해림은 어떤 사람? 🤔</span>
      </StyledTitle>
      <Row>
        <Col xs={24} md={16} xl={12}>
          <Paragraph>
            <p className='subTitle'>
              <span>✅</span>
              <span>웹 퍼블리셔 경력 3년!</span>
            </p>
            <p className='intro'>
              웹 프론트엔드 개발자 김해림은 퍼블리싱을 3년동안 한 경력이
              있습니다!
            </p>
            <p className='txt'>
              자사의 서비스 웹 페이지부터 Admin 페이지 및 SI 서비스를 퍼블리싱한
              경력이 있습니다. HTML, CSS3, JavaScript, Jquery, Ajax 언어를
              사용해왔습니다. 언제나 프로젝트는 책임감을 가지고 기간 내에
              서비스를 완성해 냈습니다!
            </p>
          </Paragraph>
        </Col>
        <Col xs={24} md={8} xl={12}></Col>
      </Row>
    </div>
  );
};

export default AboutMe;
